function getColorType(countries, id) {
  if (typeof(countries) !== undefined) {
    switch (countries[id]) {
      case 'PEAK' :
        return 'peak'
      case 'SHOULDER' :
        return 'shoulder'
      case 'OFF' :
        return 'off'
    }
  }
  else {
    return '';
  }
}

